import { Link } from 'react-router-dom';
import styles from './style.module.css';


interface ItemDropDown {
  title: string,
  url: string,
  childrens?: ItemDropDown[],
}

function NavDropDown({ title, url, childrens }: ItemDropDown) {

  return (<>
    <div className={styles.dropdowBox}>
      <a className={`nav-link ${styles.dropdow}`}>{title}<i className="fa-solid fa-chevron-down"></i></a>
      <div className={` ${styles.dropdowContent}`}>
        {
          childrens?.map((e) => (<>
            <Link to={e.url} className={`nav-link ${styles.dropdowItem}`}>{e.title}</Link>
          </>))
        }
      </div>
    </div>
  </>);
}
export default NavDropDown;
